ctually... I screenshot tied a meme from masipopal after that ', 'I think that modelling comes down to being recognizable. Being a real human with expression and individuality. Not just for the sake of uniqueness but really because it\'s where you are in your life atm. And constantly growing', 'Toner water. Lush makes a rose toner water that saves my skin every day ', 'Expressive Functional intentional ', 'Mmm people my eye colour because it changes often. Or my freckles ', 'I don\'t have one. I pull inspo from so many people and places. ', 'Haha I\'m right now crushing on Jazzelle (UglyWorldWide) she\'s just so cool. ', 'I have been following DulceDo for a while and I like what you\'re doing!! I have big goals for myself, modelling and I write songs and I am looking to build a team that has big goals for me as well!', 'resources/pictures/applicant/325/faceShot/Mccall325_faceShot.jpg', 'resources/pictures/applicant/325/profile/Mccall325_profile.jpg', 'resources/pictures/applicant/325/waistUp/Mccall325_waistUp.jpg', 'resources/pictures/applicant/325/headToToes/Mccall325_headToToes.jpg', 'resources/pictures/applicant/325/other/Mccall325_other0.jpg,resources/pictures/applicant/325/other/Mccall325_other1.jpg,resources/pictures/applicant/325/other/Mccall325_other2.jpg,resources/pictures/a', '2018-02-08 16:45:35', 'new', NULL, 'Scouted', '', 'Jessy ', 'Toronto'),
